import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';

import Operaciones from './Operaciones';
import Work from './Work';
import Slide from './Slide';
import Slidepagos from './Slidepagos';
import Galeria from './Galeria';
import Contacto from './Contacto';

// Asegúrate de tener tus archivos de componentes correspondientes

export default function Menu() {
  return (
    <Router>
      <div>
        {/* Barra de navegación */}
        <Navbar bg="dark" variant="dark" expand="lg">
          <Navbar.Brand href="/">My App</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
              <Nav.Link as={Link} to="/">Home</Nav.Link>
              <Nav.Link as={Link} to="/galery">Galery</Nav.Link>
              <Nav.Link as={Link} to="/work">People Work</Nav.Link>
              <Nav.Link as={Link} to="/contact">Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>

        {/* Rutas */}
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/galery" component={Galery} />
          <Route path="/work" component={Works} />
          <Route path="/contact" component={Contact} />
        </Switch>
      </div>
    </Router>
  );
}

// Componentes para cada página
function Home() {
  return (
    <div>
      <Slide />
      <Slidepagos />
    </div>
  );
}

function Galery() {
  return (
    <div>
      <h2 className="display-3">Galeria</h2>
      <Galeria />
    </div>
  );
}

function Works() {
  return (
    <div>
      <h2 className="display-3">People at Work</h2>
      <Work />
    </div>
  );
}

function Contact() {
  return (
    <div>
      <h2 className="display-3">Contact</h2>
      <Contacto />
    </div>
  );
}
